This module was developed, as a guide to assist Parties not included in Annex I to the Convention (Non-Annex I Parties) in the preparation of their national communications, in accordance with Article 4, paragraph 1 and Article 12, paragraph 1 of the Convention. It is the first in a series of modules developed on the various elements of a national communication (e.g. vulnerability and adaptation, national greenhouse gas (GHG) inventories, and measures to mitigate climate change) to act as a guide for non-Annex I Parties in preparation of their national communications. This module can be read alone or together with the other modules of the series, which together form the “Resource guide for preparing the national communications of non-Annex I Parties”, hereafter referred to as Resource Guide. This module is intended to act as a supplement to “Reporting on climate change: user manual for the guidelines on national communications from non-Annex I Parties”, (hereinafter referred to as User Manual) which was written to facilitate the use of the UNFCCC guidelines for the preparation of national communications from Parties not included in Annex I to the Convention (annexed to decision 17/CP.8, hereinafter referred to as UNFCCC Guidelines). The aim of the Resource Guide is to provide an entry point to the considerable additional material that has been produced since the User Manual was first published at the ninth session of the Conference of the Parties (COP 9) in 2003, and is intended to be read as an overarching document, supported by various other sources. The aims of this module are:
a) To provide an overview of the national communication preparation process (i.e. tasks, activities and outputs);
b) To understand better the objectives, agreed strategy and expected outputs and outcomes of the national communication preparation process;
c) To highlight the need for cooperation and collaboration between and among the various stakeholders in the preparation of national communications.

This module was developed as a prototype guide to assist Parties not included in Annex I to the Convention (non-Annex I Parties) to prepare the vulnerability and adaptation (V&A) section of their national communications. Although this module can be read alone, it is also the second in a series of four modules that will ultimately form a complete Resource guide for preparing the national communications of non-Annex I Parties. More importantly, this module is intended to act as a supplement to Reporting on climate change: user manual for the guidelines on national communications from non-Annex I Parties, written to support the implementation of Article 8, paragraph 2 (c), of the Convention. The Resource Guide aims to provide an entry point to the considerable additional material produced since the User Manual was first published at the ninth session of the Conference of the Parties (COP 9) in 2003, and is intended to be read as an overarching document, supported by various other sources.
The aims of this module are:
• To provide a brief overview of some of the main methods, tools and data being used by non-Annex I Parties to assess V&A to climate change, including advantages and limitations;
• To emphasize methods, particularly those that are readily accessible and applicable; 
• To describe where readers can obtain software, documentation on methods and further information.

There is a rapidly growing body of scientific knowledge on the direct and indirect effects of climate change and human development on coastal ecosystems. Increased attention is being paid to mangroves, tidal salt marshes, and seagrasses for their carbon sequestration capabilities, as well as other important ecosystem services. If properly planned and managed, coastal blue carbon could function as a potential funding mechanism for coastal ecosystem conservation and restoration. To achieve this goal, managers need to be able to assess carbon stocks
(total amount of carbon stored within a distinct area) and monitor changes in carbon stocks and greenhouse gas (GHG) emissions over time. Until recently, coastal ecosystem managers and other stakeholders interested in quantifying blue carbon have lacked practical tools and guidance to allow for proper carbon analyses. This is particularly true in developing countries where there may be large data gaps and a lack of technical and financial resources to carry out complex analyses. New guidelines and methodologies have begun to emerge in the last few years, all of which refer to the need for internationally accepted measuring and monitoring procedures for carbon accounting (Appendix A: Additional Guidance Documents). This guide will provide managers, scientists, and field practitioners with standardized recommendations and techniques for carbon measurement and analysis in blue carbon systems and directly support the assessment and accounting of blue carbon globally.
The objective of this manual is to provide standardized methods for field measurements and analysis of blue carbon stocks and flux in coastal ecosystems. The manual is designed to provide users with relevant background information on key concepts, and guide them in a step-by-step process, pointing out stages where expert advice or additional technical data may be required. The goal is to utilize these assessments to support improved conservation and restoration of coastal ecosystems through various management and policy approaches, regulatory frameworks, and participation in voluntary carbon markets. 
The manual has been designed to be used by a wide range of stakeholders, including natural resource managers, scientists, community groups, and local and national government agencies interested in assessing blue carbon stocks. It can be implemented in a range of situations, with a focus on developing country contexts, and can be tailored to the needs of specific areas according to resource availability. The manual has been designed for users with local knowledge about the system being assessed, but without necessarily a detailed technical knowledge of how to conduct blue carbon measurements.
The manual outlines the rationale and project design for measuring blue carbon in the field and approaches for data analysis and reporting. Effort was made to ensure consistency with
international standards, the Intergovernmental Panel on Climate Change (IPCC) guidelines, and other relevant sourcebooks.
The manual is structured as follows:
Chapter 1: Introduces the role of blue carbon in climate change mitigation and outlines the manual’s purpose and objectives;
Chapter 2: Outlines the main steps to prepare a robust field measurement plan; 
Chapter 3: Provides protocols and guidance for measuring organic carbon stocks found in the soils of all three ecosystems;
Chapter 4: Provides protocols and guidance for measuring organic carbon stocks, found in above- and belowground biomass, with specific protocols designed for each ecosystem;
Chapter 5: Highlights methods for determining the changes in carbon stocks over time and monitoring greenhouse gas emissions; 
Chapter 6: Gives an overview of remote sensing options and applications;
Chapter 7: Provides guidance on managing large data sets and data sharing; and
Appendices: There are several appendices; they contain supplementary information, worked through examples, lists of equations, and more.

dataproducts.abstract:
The Cloud and Aerosol Research Group (CARG) of the University of Washington participated in the SAFARI-2000 Dry Season Aircraft campaign with their Convair-580 research aircraft. This campaign covered five countries in southern Africa from August 10 through September 18, 2000. Various types of measurements were obtained on the thirty-one research flights of the Convair-580 to study their relationships to simultaneous measurements from satellites (particularly Terra), other research aircraft, and SAFARI-2000 ground-based measurements and activities.

The main goals of the University of Washington's Convair-580 research aircraft flights were to

    measure the physical and chemical properties of aerosols and trace gases in ambient air and from various sources in southern Africa;

    obtain measurements on aerosols, trace gases, clouds, and surface properties for comparisons with simultaneous remote-sensing measurements from the NASA ER-2 aircraft and Terra satellite and from SAFARI-2000 ground stations;

    carry out comparative studies using in situ and remote-sensing measurements made aboard the Convair-580;

    compare aerosol and trace gas measurements aloft at various locations in southern Africa;

    measure the nature and concentrations of aerosols and trace gases and their emission factors in smoke from prescribed fires and non-prescribed fires of biomass in southern Africa;

    measure the spectral albedo and bidirectional reflection distribution function (BRDF) of various surfaces and clouds in southern Africa;

    measure the microstructures of clouds off the Atlantic Coast of southern Africa; and

    investigate aerosol-cloud interactions;
